const require_utils = require('../../../common/utils.cjs');

//#region src/namespaces/rdf/parse/utils.ts
const retrieveAbout = (value) => {
	if (!require_utils.isObject(value)) return;
	return require_utils.trimObject({ about: require_utils.parseString(value["@about"]) ?? require_utils.parseString(value["@rdf:about"]) });
};

//#endregion
exports.retrieveAbout = retrieveAbout;